Thomas is deposited in a community of boys after his memory is erased, soon learning they're all trapped in a maze that will require him to join forces with fellow &quot;runners&quot; for a shot at escape.

Director: Wes Ball
Writers: Noah Oppenheim (screenplay), Grant Pierce Myers (screenplay)
Stars: Dylan O'Brien, Kaya Scodelario, Will Poulter
Genres: Action, Mystery, Sci-Fi, Thriller
Country: USA
Language: English


